import SideNavBar from "../Components/SideNavBar";
import Box from "@mui/material/Box";
import NavBar from "../Components/NavBar";
import { useNavigate } from "react-router-dom";
import { Avatar, Rating, Stack } from "@mui/material";
import i2 from "../image/i2.PNG";
import i3 from "../image/i3.PNG";
import i4 from "../image/i4.PNG";
import i5 from "../image/i5.PNG";
import i6 from "../image/i6.PNG";
import i7 from "../image/i7.PNG";
import i8 from "../image/i8.PNG";
import i9 from "../image/i9.PNG";

function Author() {
  const navigate = useNavigate();
  const handleClick = () => {
    navigate("/");
  };

  return (
    <>
      <NavBar />
      <Box>
        <Box height={30} />
        <Box sx={{ display: "flex" }}>
          <SideNavBar />

          <Box component="main" sx={{ flexGrow: 1, p: 3 }}>
            <h1>Author</h1>
            <Stack spacing={10} direction="row">
              <div
                style={{
                  display: "flex",
                  flexDirection: "column",
                  alignItems: "center",
                }}
              >
                <Avatar
                  src={i2}
                  alt="Pic not found"
                  sx={{ marginBottom:0, width: 160, height: 160 }}
                  onClick={handleClick}
                />
                <h3>Joseph Murphy </h3>
                <></>
               
              </div>
              <div
                style={{
                  display: "flex",
                  flexDirection: "column",
                  alignItems: "center",
                }}
              >
                <Avatar
                  src={i3}
                  alt="Pic not found"
                  sx={{ bgcolor: "secondary.main", width: 160, height: 160 }}
                  onClick={handleClick}
                />
                <h3>Robin Sharma</h3>
              </div>
              <div
                style={{
                  display: "flex",
                  flexDirection: "column",
                  alignItems: "center",
                }}
              >
                <Avatar
                  src={i4}
                  alt="Pic not found"
                  sx={{ bgcolor: "secondary.main", width: 160, height: 160 }}
                  onClick={handleClick}
                />
                <h3> Darius Foroux</h3>
              </div>
              <div
                style={{
                  display: "flex",
                  flexDirection: "column",
                  alignItems: "center",
                }}
              >
                <Avatar
                  src={i5}
                  alt="Pic not found"
                  sx={{ bgcolor: "secondary.main", width: 160, height: 160 }}
                  onClick={handleClick}
                />
                <h3>Stephen Edwin King</h3>
              </div>
            </Stack>
            <Stack spacing={10} direction="row" sx={{ marginTop: 1 }}>
              <div
                style={{
                  display: "flex",
                  flexDirection: "column",
                  alignItems: "center",
                }}
              >
                <Avatar
                  src={i6}
                  alt="Pic not found"
                  sx={{ bgcolor: "secondary.main", width: 160, height: 160 }}
                  onClick={handleClick}
                />
                <h3>Hilary Mantel</h3>
              </div>
              <div
                style={{
                  display: "flex",
                  flexDirection: "column",
                  alignItems: "center",
                }}
              >
                <Avatar
                  src={i7}
                  alt="Pic not found"
                  sx={{ bgcolor: "secondary.main", width: 160, height: 160 }}
                  onClick={handleClick}
                />
                <h3>Shashi Tharoor</h3>
              </div>
              <div
                style={{
                  display: "flex",
                  flexDirection: "column",
                  alignItems: "center",
                }}
              >
                <Avatar
                  src={i8}
                  alt="Pic not found"
                  sx={{ bgcolor: "secondary.main", width: 160, height: 160 }}
                  onClick={handleClick}
                />
                <h3>Kiran Desai</h3>
              </div>
              <div
                style={{
                  display: "flex",
                  flexDirection: "column",
                  alignItems: "center",
                }}
              >
                <Avatar
                  src={i9}
                  alt="Pic not found"
                  sx={{ bgcolor: "secondary.main", width: 160, height: 160 }}
                  onClick={handleClick}
                />
                <h3>Madhuri Banerjee</h3>
              </div>
            </Stack>
          </Box>
        </Box>
      </Box>
    </>
  );
}
export default Author;
